He-Man i She-Ra: Tajna maca (eng. He-Man and She-Ra: The Secret of the Sword) je americki animirani film fantastike iz 1985. koji je nastao po slavnim likovima iz animirane serije He-Man i Gospodari svemira. Film je prikazan nakon zavrsetka emitiranja animirane serije He-Man i Gospodari svemira i prije pocetka nove serije, She-Ra: Princeza moci. Radnja se odvija oko He-Manovog pronalaska svoje sestre, She-Re.

Film je u kinima SAD-a izasao 22. ozujka 1985. te je zaradio 7.7 milijuna $. U Njemackoj je u kinima izasao 11. prosinca 1986. S druge strane, u Hrvatskoj nije igrao u kinima nego je otisao direktno na video trziste.
